import { useParams } from 'react-router-dom';
import Api from './Api'


function Logement() {
    const data = Api();
    const idUrl  = useParams();
    const loge = []
    console.log(idUrl)
    data.forEach(function(res){ 
        console.log(res)
        if(idUrl.id == res.id){
            loge.push(res)
        }
        
    });
    console.log(loge)
    
    return (
        <div>
           <img src={log.cover} alt={log.tag} className='kasa-gallery-image-logement' />
        </div>

    )

}

export default Logement
